import React from 'react';
import ReactDOM from 'react-dom';
import Container from 'react-bootstrap/Container';
import Form from 'react-bootstrap/Form';
import { Card, CardImg, CardText, CardBody, CardTitle, CardSubtitle, CardLink } from 'reactstrap';
import Button from 'react-bootstrap/Button';
import MaterialIcons from 'material-icons-react';
import Figure from 'react-bootstrap/Figure';
import Header from './Components/Header';
import Footer from './Components/Footer';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Table from 'react-bootstrap/Table';
import Tabs from 'react-bootstrap/Tabs';
import Tab from 'react-bootstrap/Tab'
import Sweetalert from 'react-bootstrap-sweetalert';
import axios from 'axios';

class moderatorEventHandle extends React.Component {
  constructor(props) {
      super(props);
      this.state = {
        eventListArray: [],
        arrayLength: 0
      }

  }
  componentDidMount(){
    let _self_parent = this;
    axios({
      method: 'GET',
      url: '/events'
    }).then((response) => {
      console.log(response);
      if(response.data.status === "success"){
        _self_parent.setState({eventListArray: response.data.data, arrayLength: response.data.data.length});
        console.log(response.data.data);
      }
    }).catch((error) => {
      console.log(error);
    })
  }
  render() {
    return(
      <Container>
        <Header/>
            <Container style = {{marginTop: "20vh", padding: 0}}>
              <Card width = "10">
                <CardBody>
                  <CardImg width = "0.5" height = "150" src={process.env.PUBLIC_URL + 'images/events_medium.jpg'} alt="Card image cap"/>
                  <CardTitle><CardLink href = "#">Event Name</CardLink></CardTitle>
                  <CardSubtitle>Date, Time</CardSubtitle>
                  <CardText>Event Description <a href = "#">[More...]</a></CardText>
                    <div>
                        <Button className="float-left">Edit</Button>&nbsp;
                        <Button>Delete</Button>
                    </div>
                </CardBody>
              </Card>
            </Container>
      </Container>
    )
  }
}
export default moderatorEventHandle;
